import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

const curHr = new Date(1990,5,5,24).getHours();
let greeting = "";
const cssStyle = {};

if (curHr < 12) {
  greeting = "Good Morning";
  cssStyle.color = "green";
} else if (curHr < 18) {
  greeting = "Good Afternoon";
  cssStyle.color = "orange";
} else {
  greeting = "Good Night";
  cssStyle.color = "black";
}

